//////////////////////////\\n///////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\\n///////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////////\\n*/\\n/* Style the navigation container */\\n.section1 {\\n  z-index: 1;\\n  margin: 0; /* Add this line to remove any default margin */\\n  overflow: hidden; /* Add this line to hide any overflowing content */\\n}\\n\\n.navbar {\\n  background-color: transparent;\\n  padding: 10px 20px;\\n  display: flex;\\n  justify-content: center; /* Add space between items */\\n  align-items: center; /* Center items vertically */\\n  margin: 0 auto; /* Center the border horizontally */\\n  height: 30px;\\n}\\n\\n/* Style the navigation list */\\nul {\\n  list-style-type: none;\\n  display: flex;\\n  justify-content: center;\\n  padding: 0;\\n  font-size: 16px;\\n  font-family: \\\"Roboto\\\", sans-serif;\\n  font-weight: 300;\\n  letter-spacing: 1px;\\n  gap: 20px; /* Adds equal spacing between items */\\n  position: relative; /* Needed for the pseudo-element */\\n}\\n\\n/* Create a line above only the words */\\n.navbar ul::before {\\n  content: \\\"\\\";\\n  position: absolute;\\n  top: -15px; /* exactly above the sticky*/\\n  left: 0;\\n  width: 100%;\\n  height: 1px; /* Line thickness */\\n  background-color: black; /* Line color */\\n}\\n\\n/* Style the navigation list items */\\nli {\\n  margin: 0 40px; /* Add margin to create space between items */\\n  padding: 0;\\n}\\n\\n/* Style the navigation links */\\na {\\n  width: 100%;\\n  text-decoration: none;\\n  color: #000000;\\n  transition: color 0.3s ease, cursor 0.3s ease;\\n  cursor: pointer; /* Add a pointer cursor */\\n  opacity: 0.9;\\n  display: inline-block; /* Make the links inline-block elements */\\n  text-align: center; /* Center-align the text horizontally */\\n}\\n\\n/* Change link color on hover */\\na:hover {\\n  color: #666666;\\n  cursor: pointer;\\n}\\n\\n/* Style the dropdown container */\\n.dropdown {\\n  position: relative;\\n  display: inline-block;\\n  color: black;\\n  text-align: center; /* Center-align the text horizontally */\\n}\\n.dropdown::after {\\n  content: \\\"\\\";\\n  position: absolute;\\n  top: 100%; /* Starts just below the parent */\\n  left: 0;\\n  width: 100%; /* Matches parent's width */\\n  height: 50px; /* Extends hoverable area below the parent */\\n  background: transparent; /* Invisible hover zone */\\n}\\n/* Style the dropdown content */\\n.dropdown-content {\\n  display: none;\\n  position: absolute;\\n  color: black;\\n  background-color: white;\\n  width: 200px; /* Fixed width to prevent expansion */\\n  box-shadow: 0px 8px 16px rgba(0, 0, 0, 0.2);\\n  z-index: 1;\\n  top: 182%; /* Position dropdown below parent */\\n  left: 50%; /* Center dropdown relative to parent */\\n  transform: translateX(-50%); /* Adjust centering */\\n  text-align: center;\\n  transition: opacity 0.3s ease, visibility 0.3s ease; /* Smooth transitions */\\n  box-sizing: border-box; /* Ensure padding doesn't affect width */\\n}\\n\\n/* Style the dropdown links */\\n.dropdown-content a {\\n  padding: 10px 16px;\\n  display: block;\\n  color: black;\\n  text-align: center;\\n  text-decoration: none;\\n  transition: background-color 0.3s ease, color 0.3s ease;\\n  white-space: nowrap; /* Prevent text wrapping */\\n  overflow: hidden; /* Hide overflow */\\n  text-overflow: ellipsis; /* Show ellipsis for long text */\\n  box-sizing: border-box; /* Ensure padding doesn't affect width */\\n  width: 100%; /* Take full width of parent */\\n}\\n\\n/* Change dropdown link color on hover */\\n.dropdown-content a:hover {\\n  background-color: #333333;\\n  color: #ffffff;\\n  cursor: pointer;\\n}\\n\\n/* Show dropdown content on hover */\\n.dropdown:hover .dropdown-content {\\n  display: block;\\n}\\n\\n/* Add pointer cursor and color to the \\\"Face,\\\" \\\"Breast,\\\" and \\\"Body\\\" titles */\\n.dropdown:hover .dropdown-content,\\nli:hover > .dropdown-content {\\n  display: block;\\n}\\n.dropdown:hover .dropdown-content,\\n.dropdown-content:hover {\\n  display: block;\\n  opacity: 1;\\n  visibility: visible;\\n  pointer-events: auto; /* Allow interaction */\\n}\\nli.dropdown:hover > span,\\nli:hover > span {\\n  color: #666666;\\n  cursor: pointer;\\n}\\n.sticky-scroll {\\n  background-color: rgba(255, 255, 255, 0.9);\\n  position: fixed;\\n  top: 0;\\n  left: 0;\\n  right: 0;\\n  z-index: 100; /* Ensure it stays above all content */\\n  width: 100%;\\n  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1); /* Subtle shadow for better separation */\\n}\\n.sticky-scroll .main-title {\\n  color: #333;\\n  font-weight: 300 !important;\\n  transition: color 0.5s ease;\\n}\\nnav.sticky-scroll {\\n  padding: 10px 20px; /* Reduced padding for a compact sticky navbar */\\n  height: auto; /* Allow the height to adjust dynamically */\\n}\\n.navbar.sticky-scroll ul::before {\\n  opacity: 0; /* Makes the line invisible */\\n}\\n.preloader-content-wrapper {\\n  display: flex;\\n  flex-direction: column;\\n  justify-content: flex-end; /* Align content at the bottom */\\n  align-items: center; /* Center content horizontally */\\n  height: 100vh; /* Use viewport height for full screen height */\\n}\\n\\n/* Style for the content (your image) */\\n.preloader-content-wrapper img {\\n  max-width: 30%;\\n  min-width: 500px;\\n  height: auto;\\n  margin-bottom: 235px; /* Adjust this margin as needed */\\n}\\n.content-wrapper {\\n  display: flex;\\n  flex-direction: column; /* Stack items vertically */\\n  justify-content: flex-end; /* Center content vertically */\\n  align-items: center; /* Center content horizontally */\\n  height: 100vh; /* Use viewport height for full screen height */\\n  gap: 20px; /* Add spa